import React, { Component } from 'react';
import './time-picker.css';

export default class TimePicker extends Component {
    constructor() {
        super();

        this.times = [
            "07:00 - 11:00",
            "11:00 - 14:00",
            "14:00 - 17:00",
            "17:00 - 21:00"
        ];
    }

    render() {
        return ( 
            <div className="time-picker">
                Timezz
            </div>
        );
    }
}
